  false,\n\t\"url\": null,\n\t\"notes\": \"This is the fiscal year 1998 annual narrative
  report for Neal Smith National Wildlife Refuge.  The report begins with information
  about monitoring and studies which include surveys and investigations.  Habitat
  restoration and habitat management projects are also covered; activities include
  seed harvest and analysis, fire management, pest control, grazing, and haying.  Fish
  and wildlife management are discussed next.  Coordination activities are outlined,
  as well as resource protection.  Resource protection activities include law enforcement,
  permitting, and land acquisition.  Information about public education and recreation
  is given.  Finally, refuge planning and administration are discussed.  Lists of
  refuge personnel and volunteer programs are provided.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
